- input: "TEXT\x1CC00278101\x1CSB23.6735.TEXT\x1CSB23.6735\x1CSB23\x1CThis transaction
    corrects an error that occured in September 2010.  On September 13, 2010, the
    committee sent an e-mail in support of Ovide Lamontagne, who was a candidate for
    Senate in the New Hampshire primary election held on September 14, 2010, to members
    of its connected organization (Gun Owners of America, Inc.) and others.  On September
    13, 2010, a check was written to Gun Owners of America, Inc. for $85.00 for the
    list rental used for the e-mail.  The error was that this check was drawn on the
    Gun Owners of America, Inc. Political Victory Fund-Oklahoma (GOAPVF-OK) account,
    and not on the committee's federal account.  The GOAPVF-OK account is a state
    account that is used to support state and local candidates in Oklahoma, and is
    not registered with the FEC.  The GOAPVF-OK account does not have any corporate
    contributions.  The mistake was discovered on November 3, 2010, and the purpose
    of this transaction was to reimburse the GOAPVF-OK account for the $85.00 which
    was inadverntly drawn on it.\n"
